import React from "react";

import NavBar from "../../components/NavBar";

const Duummy_navbar = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];

const Home = () => {
  return (
    <div>
      <NavBar></NavBar>
    </div>
  );
};

export default Home;
